    false,nt"url": null,nt"notes": "These data represent Next-Generation Radar
    (NEXRAD) and Terminal Doppler Weather Radar (TDWR) weather radar stations within
    the US. The NEXRAD radar stations are maintained and operated by the National Oceanic
    and Atmospheric Administration (NOAA). The TDWR radar stations are maintained and
    operated by the Federal Aviation Administration (FAA). Both radar's are pulsed Doppler
    types that measure reflectivity out to 460km, and radial velocity and spectrum width
    out to 300km (NEXRAD) and 90km (TDWR). Both radars automatically scan the atmosphere
    from the surface to 70,000ft using a rotating parabolic antenna.",nt"license_title":
